const seedBooks = async () => {
  try {
    await Book.deleteMany();
    console.log("🧹 Old books removed");

    for (let b of books) {
      // Find author inside users collection
      const author = await User.findOne({
        name: new RegExp(`^${b.author}$`, "i"), // case-insensitive
        role: "author",
      });

      if (!author) {
        console.log(`❌ Author not found: ${b.author}`);
        continue; // skip this book
      }

      await Book.create({
        title: b.title,
        description: b.description,
        price: b.price,
        category: b.category,
        author: author._id, // keep as ObjectId
        coverUrl: b.coverUrl || "", // ✅ include coverUrl
        //publisher: b.publisher || "Bookztron Publications", // ✅ optional field
        status: "approved", // ✅ mark as approved
      });

      console.log(`✅ Added book: ${b.title} (by ${b.author})`);
    }

    console.log("✅ Books seeded successfully!");
    process.exit();
  } catch (error) {
    console.error("❌ Seeding failed:", error);
    process.exit(1);
  }
};

seedBooks();


































